    "about1_des": "Zuckergleiter (Petaurus breviceps) sind kleine, allesfressende, baumbewohnende und nachtaktive Tiere. Dieses Tier kann gleiten und hat einen Beutel (Infraklasse). Dieser gebräuchliche Name bezieht sich auf seine Vorliebe für süße Speisen wie Nektar und seine Fähigkeit, wie ein fliegendes Eichhörnchen durch die Luft zu schweben.\n     \nZuckersegelflugzeuge sind in den nördlichen und östlichen Teilen des australischen Festlandes, Tasmaniens, Neuguineas und verwandten Inseln wie dem Bismarck-Archipel, den Louisiade-Inseln und bestimmten indonesischen Inseln wie den Halmahera-Inseln in Nord-Maluku zu finden.\n\nIn letzter Zeit ist dieses Tier sehr beliebt, weil es ein süßes und entzückendes Haustier ist. Das Alter des Sugar Gliders ist auch ziemlich lang, es kann etwa 10-15 Jahre betragen. Zuckersegelflugzeuge, die 0-3 Monate alt sind, werden Joeys genannt und diejenigen, die älter sind, werden erwachsene Zuckersegelflugzeuge genannt"
