  "about1": {
    "about1title": "Apa itu Sugar Glider",
    "about1caption": "Sugar glider ( Petaurus breviceps ) adalah hewan kecil, omnivora , arboreal , dan hewan malam hari",
    "about1_des": "Sugar glider ( Petaurus breviceps ) adalah hewan kecil, omnivora , arboreal , dan hewan malam hari. Hewan ini bisa meluncur dan memiliki kantung (Infraclass) . Nama umum ini mengacu pada kegemarannya terhadap makanan manis seperti nektar dan kemampuannya untuk melayang di udara, seperti tupai terbang .\n     \nSugar glider dapat ditemukan di seluruh bagian utara dan timur daratan Australia, Tasmania, New Guinea dan beberapa pulau terkait seperti Kepulauan Bismarck , Kepulauan Louisiade , dan pulau-pulau tertentu di Indonesia seperti Kepulauan Halmahera di Maluku Utara. \n\nBelakangan ini hewan ini sedang banyak digemari karena menjadi hewan peliharaan yang lucu dan menggemaskan. Umur dari Sugar Glider juga tergolong lama bisa sekitar 10-15 tahun. Sugar glider yang masih berumur 0-3  bulan di sebut Joey dan umur diatas itu disebut Sugar glider dewasa"
  },
  "about2": {
    "about2title": "Sebelum Memelihara",
    "about2caption": "Persiapan sebelum adopsi",
    "komitmen": "1. Komitmen",
    "komitmen_des": "Dalam memelihara Sugar glider kita selaku owner wajib berkomitmen dalam memelihara nya. Dari mulai mampu ketersediaaan pakan yang bergizi, kandang yang luas, tempat yang nyaman, dan juga waktu yang cukup untuk bersosialisasi pada pelihaan kita.",
    "komunitas": "2. Bergabung dengan komunitas",
    "komunitas_des": "Bergabung komunitas Sugar glider sangat membantu owner dalam memelihara hewan unik tersebut. Karena kita sebagai owner bisa lebih leluasa mempertanyakan masalah yang owner hadapi terkait Sugar glider dan dijawab langsung oleh orang-orang yang sudah berpengalaman.",
    "tips": "3. Tips memilih Sugar Glider",
    "tips_des": "Jika ingin mengadopsi SG, sebaiknya cari tau terlebih dahulu ciri-ciri SG secara baik dan benar.  Karena banyak kasus penipuan dilakukan oleh penjual yang tak bertanggung jawab seperti menjual  FS (Flying Squirrel) namun si penjual bilang bahwasannya itu adalah SG. Ini juga disebabkan oleh owner yang tidak teliti dan tidak mengetahui SG secara fisik\n \nCarilah breeder atau peternak SG yang terpercaya .Disarankan, anda lebih baik survey langsung kerumah breeder atau penjual agar anda dapat langsung melihat sebelum diadopsi. Mintalah kepada penjual perlihatkan gigi SG apakah lengkap atau dipotong, banyak SG yg giginya dipotong dengan tujuan agar terlihat jinak tapi SG yang giginya dipotong kebanyakan sering mengalami Abses sehingga nafsu makannya menghilang, akibatnya SG akan cepat mengalami kematian.\n \nAnda dapat mengadopsi SG yang sudah berumur 3 bulan karena sudah dapat dikatakan mandiri. Dan jika mengadopsi SG di umur yang masih muda maka SG akan cepat dengan mudah bonding kepada owner-nya."
  },
  "about3": {
    "about3title": "Set Up Kandang",
    "about3caption": "Kandang yang baik akan berpengaruh pada kenyamanan sugar glider.  Set-up kandang Sugar Glider pada umumnya antara lain :",
    "pilihkandang": "1. Pilih kandang yang ideal",
    "pilihkandang_des": "Ada banyak jenis kandang untuk SG , namun yang terpenting adalah kandang berukuran besar dan memiliki ruas lubang yang kecil. Pada umumnya owner menggunakan kandang besi dengan ukuran 60x43x43(PxLxT) karena luas dari kandang ini cukup untuk Sugar Glider bermain.",
    "aksesoris": "2. Aksesoris dalam kandang",
    "aksesoris_des": "Sugar glider adalah hewan malam atau nokturnal yang terbiasa tidur di pohon saat berada di alam liar. Agar menyerupai habitat asli dan membuatnya nyaman, maka kita dapat menyediakan kantong dari wol(pouch) atau rumah burung dari kayu yang aman.\n\nSebatang kayu juga berfungsi untuk mengasah gigi dan kuku SG. Dengan memilih kayu yang aman seperti jenis eucalyptus, manzanita atau kayu pohon apel atau kayu kopi (namun kayu ini harus sering diganti karena jika sudah terkena air kencing kayu ini akan lembab dan bulu sugar glider akan menguning jika terkena kayu tersebut).\n\nDan jangan lupa menyediakan tempat makan dan minum untuk Sugar Glider. Biasanya owner memakai tempat makan plastik kecil atau piring plastik untuk tempat makan SG karena ringan dan mudah dibersihkan. Untuk tempat minum, owner biasanya memakai botol dot khusus pet karena simple dan tidak mudah tumpah\n\nSelain itu, sugar glider juga merupakan hewan yang cerdik atau pintar sehingga perlu diberi stimulasi agar tidak stress atau depresi. Kondisi stress ini dapat memicu masalah kesehatan lainnya yang tentu sangat dihindari.\n\nOleh karena itu, kita bisa menambahkan mainan untuk stimulasi otak dan fisiknya. Beberapa juga menggunakan permainan roda putar, rantai , dsb. sehingga mereka akan tumbuh sehat dan aktif.",
    "alas": "3. Alas kotoran kandang",
    "alas_des": "Alas kotoran kandang juga perlu diperhatikan agar SG merasa nyaman dan terhindar dari berbagai penyakit.  Pada umumnya owner memberikan pasir wangi pada alas nya mengingat kotoran SG yang cukup bau. Ada juga yang memakai serbuk kayu halus karena benda tersebut dapat dengan mudah menyerap kadar air, namun kekurangan dari serbuk kayu ini cepat lembab dan mudah berhamburan."
  },
