  "about1": {
    "about1title": "Cos'è il petauro dello zucchero?",
    "about1caption": "Il petauro dello zucchero (Petaurus breviceps) è un animale piccolo, onnivoro, arboricolo e notturno.",
    "about1_des": "I petauri dello zucchero (Petaurus breviceps) sono animali piccoli, onnivori, arboricoli e notturni. Questo animale può planare e ha una sacca (Infraclasse). Questo nome comune si riferisce alla sua propensione per i cibi dolci come il nettare e la sua capacità di librarsi nell'aria, come uno scoiattolo volante.\n     \nI petauri dello zucchero si possono trovare in tutte le parti settentrionali e orientali dell'Australia continentale, della Tasmania, della Nuova Guinea e delle isole correlate come l'arcipelago di Bismarck, le isole Louisiade e alcune isole indonesiane come le isole Halmahera nelle Molucche settentrionali.\n\nUltimamente, questo animale è molto popolare perché è un animale domestico carino e adorabile. Anche l'età dello Sugar Glider è piuttosto lunga, può aggirarsi intorno ai 10-15 anni. I petauri dello zucchero che hanno ancora 0-3 mesi si chiamano Joey e quelli di età superiore sono chiamati petauri dello zucchero adulti"
  },
