    "about2title": "Prima dell'adozione",
    "about2caption": "Preparazione prima dell'adozione",
    "komitmen": "1. Impegno",
    "komitmen_des": "Nel mantenere il nostro Sugar glider come proprietario, dobbiamo impegnarci a mantenerlo. A partire dalla capacità di fornire mangime nutriente, gabbie spaziose, luoghi confortevoli e anche abbastanza tempo per socializzare con i nostri animali domestici.",
    "komunitas": "2. Unisciti alla community",
    "komunitas_des": "Entrare a far parte della community di Sugar glider aiuta davvero il proprietario a mantenere questi animali unici. Perché noi come proprietari possiamo mettere più liberamente in discussione i problemi che il proprietario deve affrontare per quanto riguarda gli alianti dello zucchero e ricevere risposte direttamente da persone esperte.",
    "tips": "3. Suggerimenti per la scelta di un petauro dello zucchero",
    "tips_des": "Se vuoi adottare SG, dovresti prima scoprire le caratteristiche di SG in modo corretto e corretto. Perché molti casi di frode vengono eseguiti da venditori irresponsabili come la vendita di FS (scoiattolo volante) ma il venditore dice che è SG. Questo è causato anche dal proprietario che non sta attento e non conosce SG fisicamente\n \nCerca un allevatore di fiducia o un allevatore di SG. Si consiglia di fare un sopralluogo diretto alla casa dell'allevatore o del venditore in modo da poter vedere subito prima dell'adozione. Chiedi al venditore di mostrare i denti di SG se sono completi o tagliati, molti SG si fanno tagliare i denti con l'obiettivo di farli sembrare docili, ma gli SG i cui denti vengono tagliati per lo più spesso sperimentano ascessi in modo che il loro appetito scompaia, di conseguenza SG morirà presto.\n \nPuoi adottare una SG che ha 3 mesi perché si può dire che sia indipendente. E se adotti SG in giovane età, allora SG si legherà rapidamente al proprietario."
  },
  "about3": {
    "about3title": "Configurazione della gabbia",
    "about3caption": "Una buona gabbia influenzerà il comfort del petauro dello zucchero. La configurazione generale di una gabbia Sugar Glider include:",
    "pilihkandang": "1. Scegli la gabbia ideale",
    "pilihkandang_des": "Esistono molti tipi di gabbie per SG, ma la più importante è che la gabbia sia grande e abbia un piccolo segmento di foro. In generale, il proprietario usa una gabbia di ferro con una dimensione di 60x43x43 (LxWxH) perché l'area di questa gabbia è sufficiente per far giocare Sugar Glider.",
    "aksesoris": "2. Accessori nella gabbia",
    "aksesoris_des": "I petauri dello zucchero sono animali notturni o notturni che sono abituati a dormire sugli alberi quando sono allo stato brado. Per assomigliare all'habitat naturale e renderlo confortevole, possiamo fornire una custodia in legno sicura o una casetta per uccelli.\n\nUn bastoncino di legno serve anche per affilare i denti e le unghie di SG. Scegliendo legno sicuro come eucalipto, manzanita o legno di melo o legno di caffè (ma questo legno deve essere sostituito spesso perché se esposto all'urina questo legno si inumidirà e la pelliccia del petauro dello zucchero ingiallirà se è esposta al Di legno).\n\nE non dimenticare di fornire un posto dove mangiare e bere per Sugar Glider. Di solito il proprietario usa un piccolo posto di plastica per mangiare o un piatto di plastica per la SG perché è leggero e facile da pulire. Per i posti dove bere, il proprietario di solito usa una bottiglia speciale per animali domestici perché è semplice e non si rovescia facilmente\n\nInoltre, i petauri dello zucchero sono anche animali intelligenti o intelligenti, quindi hanno bisogno di essere stimolati in modo che non si stressino o si deprimano. Questa condizione stressante può innescare altri problemi di salute che sono sicuramente molto evitabili.\n\nPertanto, possiamo aggiungere giocattoli per la stimolazione cerebrale e fisica. Alcuni usano anche giochi con la ruota che gira, catene, ecc. In modo che crescano sani e attivi.",
    "alas": "3. Stuoia di letame",
    "alas_des": "Anche la lettiera deve essere considerata in modo che SG si senta a suo agio ed eviti varie malattie. In generale il proprietario dà sabbia profumata sulla base considerando lo sporco SG che è piuttosto maleodorante. Ci sono anche quelli che usano la segatura fine perché può assorbire facilmente il contenuto di umidità, ma lo svantaggio di questa segatura è che diventa rapidamente umida e si disperde facilmente."
  },
