    "telurrebus_des": "ไข่ต้มเป็นแหล่งโปรตีนชั้นดี อุดมไปด้วยสารอาหาร กินง่ายมาก ทำให้น้ำหนักขึ้นเร็ว Sugar Glider\n\nไข่ลวกทั้งฟองมีโปรตีน 6 กรัมและกรดอะมิโน 9 ชนิด\n\nมีสารอาหารครบถ้วน เช่น คาร์โบไฮเดรต แคลเซียม ฟอสฟอรัส วิตามินเอ และวิตามินบี\n\nส่วนนี้เพียงพอสำหรับไข่ลวกหนึ่งหรือครึ่งเปลือกและหั่นเป็นชิ้นเล็ก ๆ",
