    "about1_des": "Tàu lượn đường (Petaurus breviceps) là một loài động vật nhỏ, ăn tạp, sống trên cây và sống về đêm. Con vật này có thể trượt và có túi (Infraclass). Cái tên phổ biến này đề cập đến sở thích của nó đối với các loại thực phẩm ngọt như mật hoa và khả năng lướt trong không khí, giống như một con sóc bay.\n \nCó thể tìm thấy tàu lượn đường ở khắp các vùng phía bắc và phía đông của lục địa Australia, Tasmania, New Guinea và một số đảo có liên quan như Quần đảo Bismarck, Quần đảo Louisiade, và một số đảo ở Indonesia như Quần đảo Halmahera ở Bắc Maluku. \n\nGần đây, loài động vật này rất được ưa chuộng vì là thú cưng dễ thương và đáng yêu. Tuổi của Sugar Glider cũng khá dài, có thể khoảng 10-15 năm. Tàu lượn đường vẫn còn 0-3 tháng tuổi được gọi là Joeys và những người trên độ tuổi đó được gọi là tàu lượn đường trưởng thành"
